import React from "react";
import { Link } from "react-router-dom";
import "../styles/Navbar.css";
/*import heroBg from "../styles/hero-bg.jpg"; */

export default function Navbar() {
  return (
    <nav className="navbar">
      <div className="nav">
        <h1 className="logo">Intellibridge</h1>
        {/*for logo?*/}
              {/*<div className="imgg">
                <img src={heroBg} alt="Background visual" />
              </div>*/}
        <ul>
          <li><Link to="/"></Link></li> {/*single page navigation*/}
          <li><Link to="/about"></Link></li>{/*link for internal navigation in react */}
          <li><a href="#services">Services</a></li>{/*a for external navigation*/}
          <li><a href="#domains">Domains</a></li>
          <li><a href="#whyus">Why Us</a></li>
          <li><a href="C:\Users\arpit\OneDrive\Desktop\intellibridge - lite\intellibridge-clone\src\components\Contact.js">Contact</a></li>
          <li><button className="get-started">Get Started</button></li>
        </ul>
      </div>
    </nav>
  );
}
